import './App.css';
import InputSearch from './InputSearch';
import SearchButton from './SearchButton';
function App(props) {
  return (

    <div className="App">
      <header className="App-header">

        <p>
          Hello World
        </p>
        <InputSearch/>
        <SearchButton/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >

        </a>
      </header>
    </div>
  );
}

export default App;
